import axios from 'axios'
import { authHeader } from '../helpers/authservice/auth-header';


class GTDDataService {

    getAll(fields, sorts, pages) {

        let dataVals = {
            pages
        };


        let config = {
            headers: authHeader(),

        }
        console.log(dataVals)
        return axios.post('/api/v3//GTD/list', pages, config)
    }

    get(id) {
        let config = {
            headers: authHeader()
        }
        return axios.get(`/api/v3/GTD/${id}`, config);
    }

    create(data) {
        let config = {
            headers: authHeader()
        }
        console.log(config)
        console.log(data)
        return axios.post("/api/v3//GTD", data, config);
    }

    update(id, data) {
        let config = {
            headers: authHeader()
        }
        return axios.put(`/api/v3/GTD/${id}`, data, config);
    }

    delete(id, data) {
        let config = {
            headers: authHeader()
        }
        return axios.delete(`/api/v3/GTD/${id}`, data, config);
    }

    deleteAll() {
        return axios.post(`/api/v3/GTD`);
    }

    findByGTDName(name) {
        return axios.post(`/api/v3/GTD?name=${name}`);
    }
}

export default new GTDDataService();
